import React, { useState, useEffect } from 'react';
import '../styles/Navbar.css';
import { FiHome, FiSearch, FiDollarSign, FiUser, FiChevronDown, FiLogIn } from 'react-icons/fi';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);
  const [activeLink, setActiveLink] = useState('home');

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 10) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setIsMenuOpen(false);
  };

  return (
    <nav className={`navbar ${scrolled ? 'scrolled' : ''}`}>
      <div className="navbar-logo">
        <span className="navbar-logo-icon">üè°</span>
        SwissHomes
      </div>

      <div 
        className={`menu-toggle ${isMenuOpen ? 'active' : ''}`} 
        onClick={toggleMenu}
        aria-label="Toggle menu"
      >
        <span></span>
        <span></span>
        <span></span>
      </div>

      <ul className={`navbar-links ${isMenuOpen ? 'active' : ''}`}>
        <li>
          <a 
            href="#home" 
            className={activeLink === 'home' ? 'active' : ''}
            onClick={() => {
              setActiveLink('home');
              closeMenu();
            }}
          >
            <FiHome /> Home
          </a>
        </li>
        <li className="dropdown">
          <a 
            href="#buy" 
            className={activeLink === 'buy' ? 'active' : ''}
            onClick={() => {
              setActiveLink('buy');
              closeMenu();
            }}
          >
            <FiSearch /> Buy a Home <FiChevronDown size={16} />
          </a>
          <div className="dropdown-content">
            <a href="#apartments">Apartments</a>
            <a href="#houses">Houses</a>
            <a href="#luxury">Luxury Properties</a>
            <a href="#new">New Developments</a>
          </div>
        </li>
        <li>
          <a 
            href="#rent" 
            className={activeLink === 'rent' ? 'active' : ''}
            onClick={() => {
              setActiveLink('rent');
              closeMenu();
            }}
          >
            <FiDollarSign /> Rent a Home
          </a>
        </li>
        <li>
          <a 
            href="#sell" 
            className={activeLink === 'sell' ? 'active' : ''}
            onClick={() => {
              setActiveLink('sell');
              closeMenu();
            }}
          >
            <FiUser /> Sell Your Home
          </a>
        </li>
        <li>
          <a 
            href="#about" 
            className={activeLink === 'about' ? 'active' : ''}
            onClick={() => {
              setActiveLink('about');
              closeMenu();
            }}
          >
            About Us
          </a>
        </li>
        
        <div className="navbar-auth">
          <a href="#login" className="login-btn" onClick={closeMenu}>
            <FiLogIn /> Login / Sign Up
          </a>
          
          {/* Uncomment this if you want to show user profile when logged in */}
          {/* <div className="user-profile">
            <img 
              src="https://randomuser.me/api/portraits/women/44.jpg" 
              alt="User profile" 
              className="user-avatar"
            />
          </div> */}
        </div>
      </ul>
    </nav>
  );
};

export default Navbar;
